import '../style/Authentication.css'
function Authentication () {
    return (
      <div className='box'>
        <h1>Авторизация</h1>
        <input type='text' class='password' placeholder='Введите пароль' id='password'></input>
        <input type='text' class='login' placeholder='Введите логин' id='login'></input>
        <input type='button' class='button' value='Войти' onclick='registration'></input>
      </div>
    );
  }
  
  export default Authentication ;
